   2 interface et3/1/1,3/2/1,3/9/1,3/10/1
   3 no shutdown
   4 end
!
alias unshut-xp
   1 config
   2 interface et3/7/1,3/8/1,3/15/1,3/16/1
   3 no shutdown
   4 end
